window.bookSummaryJSON = "<p>1803. The Napoleonic Wars. A Royal Navy warship is ordered to pursue an enemy frigate to the icy waters far south in the Indian Ocean. There, it must capture the enemy ship and retrieve a mysterious sea chest, contents unknown, failure not permitted.</p> <p>For the determined young captain and his eager crew, this already dangerous mission turns into a battle with a mysterious vessel that appears not in the sea, but unbelievably, impossibly, in the sky above.</p> <p>But nothing could prepare the crew for what lay beyond the 50th latitude of south.</p> <p>Embark on an astonishing adventure in <i>Fifty Degrees South</i>, the action-packed, science fiction novel that listeners around the world can't turn off.</p>"; 
